SELECT MAX("upravna_enota"."id_upravna_enota") as agg_0, SUM("oseba"."drzavljanstvo" + "nesreca"."x") as agg_1 FROM "nesreca" LEFT OUTER JOIN "upravna_enota" ON "nesreca"."upravna_enota" = "upravna_enota"."id_upravna_enota" LEFT OUTER JOIN "oseba" ON "nesreca"."id_nesreca" = "oseba"."id_nesreca"  WHERE "oseba"."strokovni_pregled_d" IN ('I', 'D', 'E', 'H') AND "upravna_enota"."ime_upravna_enota" LIKE '%p%ri%' AND "upravna_enota"."povrsina" = 133